import react from 'react';
import Button  from '../../container/button';
import './styles.scss';

interface allDivPlayer {
    beeingPlaying: boolean, 
    level: number, 
    levelUp: number,
}

const AllDivButton = ({ beeingPlaying, level, levelUp }: allDivPlayer) => (
  <div className='allDivButton'>
  {!beeingPlaying && <Button buttonName={'begin'} buttonClass={'allDivButton'} /> }
  {beeingPlaying && <Button buttonName={'attack'} buttonClass={'allDivButton'} dommage_min={ 3 * (levelUp /100)} dommage_max={ 7 * (levelUp /100)}/>}
  {beeingPlaying && <Button buttonName={'fireBall'} buttonClass={'allDivButton'} dommage_min={ 10 * (levelUp /100)} dommage_max={ 15 * (levelUp /100)} />}
  {beeingPlaying && <Button buttonName={'fireCone'} buttonClass={'allDivButton'} dommage_min={ (levelUp / 100 ) + '/s'} />}
  {beeingPlaying && <Button buttonName={'heal'} buttonClass={'allDivButton'} />}
  {beeingPlaying && <Button buttonName={'giveUp'} buttonClass={'allDivButton'} />}
  </div>
)

export default AllDivButton
